/** @format */

import React from "react";

const TableComponent = ({ data }) => {
  return (
    <table border="1">
      <thead>
        <tr>
          <th></th>
          <th>Empty</th>
          <th>Maximum</th>
          <th>Minimum</th>
          <th>Average</th>
        </tr>
      </thead>
      <tbody>
        {data.map((row, index) => (
          <tr key={index}>
            <td>{row[0]}</td>
            <td>{row[1]}</td>
            <td>{row[2]}</td>
            <td>{row[3]}</td>
            <td>{row[4]}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default TableComponent;
